export class MemoryStore {
    constructor() {
        this.sessions = new Map();
    }
    getSession(id) {
        return this.sessions.has(id) ? this.sessions.get(id) : null;
    }
    createSession(data, id) {
        this.sessions.set(id, data);
    }
    deleteSession(id) {
        this.sessions.delete(id);
    }
    persistSession(data, id) {
        this.sessions.set(id, data);
    }
}
